 BEGIN
 DROP TABLE Memberships
 END 
 
 CREATE TABLE Memberships
 (
	MembershipID INT NOT NULL Identity(1,1),
	AdultFlag BIT NOT NULL,
	Banflag BIT NOT NULL,
	FirstName Nchar(20) NOT NULL,
	MiddleInit Nchar(1),
	LastName Nchar(20) NOT NULL,
	AddressLine1 Nchar(30) NOT NULL,
	AddressLine2 Nchar(20),
	Zipcode Nchar(20) NOT NULL, 
	State Nchar(2) NOT NULL,
	HomePhone Nchar(15),
	MobilePhone Nchar(15),
	EmailAddress Nchar(40),
	PRIMARY KEY (MembershipID)
)



