 CREATE TABLE Checkout
 (
    CheckoutID int NOT NULL Identity (1, 1),
	Membershipid INT NOT NULL,
	PubID INT NOT NULL,
	Latefee money, 
	dmgfee money, 
	membershipfee money, 
	donations money, 
	balance money, 
	checkoutdate date,
	duedate date,
	overdueflag bit,
	damageflag bit, 
	notes text,
	PRIMARY KEY (checkoutid),
	CONSTRAINT FK_Checkout_Publications FOREIGN KEY (Pubid) REFERENCES Publications(Pubid),
	CONSTRAINT FK_Checkout_memberships FOREIGN KEY (membershipid) REFERENCES memberships(membershipid)
)
 declare @counter INT = 1
WHILE @counter !> 10
BEGIN
declare @feerandomizer money = (select round((rand() * (Rand() * 10)), 0))
 declare @Latefee money = (select round((rand() * (Rand() * 10)), 0))
  declare @Dmgfee money = (select round((rand() * (Rand() * 10)), 0))
   declare @Membershipfee money = (select round((rand() * (Rand() * 10)), 0))
    declare @donations money = (select round((rand() * (Rand() * 10)), 0))
	 declare @balance money = (select round((rand() * (Rand() * 150)), 2))
 declare @FromDate date = '1996-05-01'
 declare @ToDate date = getdate()
 declare @DateRandomizer datetime = (select dateadd(day, 
               rand(checksum(newid()))*(1+datediff(day, @FromDate, @ToDate)), 
               @FromDate))
 declare @duedate date = (SELECT DATEADD(month, 1, (@DateRandomizer)))
 


 insert checkout (membershipid, pubid, latefee, dmgfee, membershipfee, donations, balance, checkoutdate, duedate)
 values ((select ROUND((RAND() * 366), 0)), (select ROUND((RAND() * 997), 0)), @latefee, @dmgfee, @membershipfee, @donations, @balance, @daterandomizer, @duedate)


SET @counter = @Counter + 1
END


